import React from "react";
import classes from "./Input.module.css";
const Input = (props) => {
  return (
    <input
      className={classes.control}
      type={props.type}
      id={props.id}
      value={props.value}
      onChange={props.onChangeHandler}
      onBlur={props.onValidateHandler}
    />
  );
};

export default Input;
